@petebacondarwin I'm using attr.$normalize as you suggested in https://github.com/angular/angular.js/pull/10337#issuecomment-65783835

The problem is that we also need to [normalize the name in the service](https://github.com/cironunes/angular.js/blob/325f609582992730f43d2ccf859bbc9f6d03e6c1/src/ngAria/aria.js#L181). Probably that's why the local ```camelCase``` method was created in the first place.

I still think that we should have a public ```camelcase```as we do with ```lowercase``` and ```uppercase```, but I'm not sure how to better approach this, what do you think?

we need to support multiple instances of angular on our page to support an enterprise rollout, where our instance is effectively 3rd party js. To do this we end up setting `$window.angular` to our instance of angular, but `window.angular` is undefined or their instance of angular if they have one. This will throw for us if they don't have their own instance of angular (`window.angular` is undefined.)  

In case you're wondering... we are also hijacking `$window` so that when we set `$window.angular` it doesn't set `window.angular`

```javascript
.service('$window', function(){
            // angular isn't actually wrapping window - so if you set something it is available on window
            // this probably has side effects :(
            var $window = Object.create(window);

            // angular has some references to itself through window (search for $window.angular.callbacks)
            // we want it to use ours not the "real" one if there is another one later...
            $window.angular = angular;

            // this is sacrificing JSONP with $http but that is ok with us
            return $window;
        })
```

@lgalfaso here is a little PR for the numberFilter that doesn't aim at changing the current code structure. My goal here was to share tests that I've added while looking at this filter code. IMO it would be good to get them in before doing bigger refactorings on this filter.

As a side effect this PR fixes inconsistency in formatting numbers that round to zero.

Once again, I'm not trying to clean up the whole code here but do minimal changes that fixes inconsistencies and bring in more tests. For me the value of this PR is in tests.
